adverts.description:
Volkswagen Polo Respect + Зимний пакет, октябрь 2021 года;

- Цвет: мокрый асфальт
- Машина на механика (1,6 л, 90 л.с., 5-ступенчатая механическая коробка передач).
- Я единственный владелец и относился к машине, как к сокровищу.
- Машина в идеальном состоянии и полностью на гарантии.
- Родной пробег 15 370 км.
- Сидения как новые. C самой покупки были в чехлах от компании "avtopilot" так что выгорания или протирания сидений тут и близко нет. Прекрасная защита и внешний вид сидений.
- Багажник не просто большой, он огромный. Машина liftback, что значит, что багажник открывается вместе в задним стеком.
- В дополнение к комплектации respect покупались пакеты зимним и комфорт:

   Зимний:
     - Обогрев лобового стекла и зеркал заднего вида;
     - Обогрев заднего стекла;
     - Подогревы передних сидений;
     - Климат-контроль автоматический "Climatronic" с режимом рециркуляции;
     - Салонное зеркало с автозатемнением;
     - Датчики света и дождя.

   Комфорт:
     - Датчики парковки спереди и сзади;
     - Мультифункциональное рулевое колесо с кожаной отделкой;
     - Центральный подлокотник спереди с боксом;
     - Кожаная отделка рукояток рычагов КП и стояночного тормоза.

В машине так же есть Andorid Auto что позволяет вам подключить свой телефон и пользоваться большим количеством приложений (навигатор: Yandex, Google, музыка: Yandex, Spotify, а если немного заморочится, то можно даже youtube использовать)

Все ТО и работы делались только у дилера, поэтому машина в идеальном техническом состоянии. (есть вся история обслуживания)

Отдам вместе с машиной комплект зимней резины, чтобы вы были готовы ко всем капризам погоды.

Перекупам, площадкам, не беспокоить!

P.s. Это не просто машина, это часть моей жизни, которую я бережно обслуживал и ухаживал за ней.

P.s.s Торг в разумных пределах.
